INSERT INTO `blog_comments` (`comment_ID`, `comment_post_ID`, `comment_author`, `comment_author_email`, `comment_author_url`, `comment_author_IP`, `comment_date`, `comment_date_gmt`, `comment_content`, `comment_karma`, `comment_approved`, `comment_agent`, `comment_type`, `comment_parent`, `user_id`) VALUES
(1, 1, 'A WordPress Commenter', 'wapuu@wordpress.example', 'https://wordpress.org/', '', '2018-07-10 09:51:39', '2018-07-10 09:51:39', 'Hi, this is a comment.\nTo get started with moderating, editing, and deleting comments, please visit the Comments screen in the dashboard.\nCommenter avatars come from <a href=\"https://gravatar.com\">Gravatar</a>.', 0, '1', '', '', 0, 0),
(2, 1, 'keo nha cai', 'yakovyfnkho@mail.ru', 'http://keo365.com/the-thao', '23.94.206.116', '2018-09-08 09:48:24', '2018-09-08 09:48:24', 'I was wondering if you ever thought of changing the page layout of your \r\nblog? Its very well written; I love what youve got to say. But maybe you \r\ncould a little more in the way of content so people could connect \r\nwith it better. Youve got an awful lot of text for only having 1 or 2 pictures.\r\nMaybe you could space it out better? http://keo365.com/the-thao', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; TCO_20180619181606; rv:11.0) like Gecko,gzip(gfe)', '', 0, 0),
(3, 1, 'keo nha cai', 'yakovyfnkho@mail.ru', 'http://keo365.com/the-thao', '23.94.206.116', '2018-09-08 09:48:44', '2018-09-08 09:48:44', 'I was wondering if you ever thought of changing the page layout of your blog?\r\nIts very well written; I love what youve got to say.\r\nBut maybe you could a little more in the way of \r\ncontent so people could connect with it better. Youve got an awful lot of text for only having 1 or 2 pictures.\r\nMaybe you could space it out better? http://keo365.com/the-thao', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; Trident/7.0; TCO_20180619181606; rv:11.0) like Gecko,gzip(gfe)', '', 0, 0),
(4, 1, '188bet', 'aubreeofaulkl@mail.ru', 'http://www.mbet88vn.com', '107.174.226.148', '2018-09-08 23:02:19', '2018-09-08 23:02:19', 'Hello there! This blog post couldn\'t be written any better!\r\nGoing through this article reminds me of my previous \r\nroommate! He continually kept talking about this.\r\nI will send this post to him. Fairly certain he\'ll have a good read.\r\nMany thanks for sharing! http://www.mbet88vn.com', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.26 Safari/537.36 Core/1.63.5359.400 QQBrowser/10.0.1299.400', '', 0, 0),
(5, 1, '188bet', 'aubreeofaulkl@mail.ru', 'http://www.mbet88vn.com', '107.174.226.148', '2018-09-08 23:02:40', '2018-09-08 23:02:40', 'Hello there! This blog post couldn\'t be written any better!\r\nGoing through this article reminds me of my previous \r\nroommate! He continually kept talking about \r\nthis. I will send this post to him. Fairly certain he\'ll have a good read.\r\nMany thanks for sharing! http://www.mbet88vn.com', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/63.0.3239.26 Safari/537.36 Core/1.63.5359.400 QQBrowser/10.0.1299.400', '', 0, 0),
(6, 1, 'TammyJuicy', 'almamcconnell@gawab.com', 'https://SamiraSee.wix.com', '91.240.125.106', '2018-09-09 10:41:55', '2018-09-09 10:41:55', 'Hi. I see that you don\'t update your blog too often. I know \r\nthat writing articles is time consuming and boring. But did you know that there is a tool that allows \r\nyou to create new posts using existing content (from article directories or other pages from your niche)?\r\n\r\nAnd it does it very well. The new articles are high quality and pass the copyscape test.\r\nSearch in google and try:  miftolo\'s tools', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; WOW64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3393.4 Safari/537.36', '', 0, 0);
