(1, 1, 'Disclaimer', 'disclaimer', '<span style=\"font-weight: bold;\">Disclaimer</span>\r\n<p>Welcome to PayRentz website. This website is operated by PR Rental Solutions Pvt Ltd (\"PayRentz). PayRentz provides this website as part of its overall service to you. By accessing or using any of the content, information, data, text, graphics, photographs and other materials (\"material\") on this website you agree to these Terms of Use. If you do not agree, you should not use this website.</p>\r\n<p>In addition to these Terms of Use, your use of certain services or parts of this website may be subject to specific and additionalterms. Since you are also bound by these additional terms, you should review them where they are provided on this website. The specific terms take priority over these Terms of Use to the extent of any inconsistency. These are the current Terms of Use and they replace any other terms of use for this website previously published on this website. PayRentz may at any time vary the Terms of Use by publishing the amended Terms of Use on this website. You accept that by doing this, PayRentz has provided you with sufficient notice of the amendment. By continuing to access or use any Material on this website after any amendment, you confirm your agreement to these Terms of Use, as amended.</p><span style=\"font-weight: bold;\">Supported Browsers</span>\r\n<p>This website has been designed for optimal performance with the following browsers:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Microsoft Internet Explorer version 7 or above</li>\r\n	<li>Safari Version 2 or above</li>\r\n	<li>Mozilla Firefox version 2 or above</li>\r\n</ul><span style=\"font-weight: bold;\">Links to other websites</span>\r\n<p>PayRentz website may contain links to other websites operated by third parties (\"third party websites\"). Those third party websites are not under the control of PayRentz, and PayRentz does not endorse and is not responsible for any material on, or linked to from, third party websites (\"third party material\").</p>\r\n<p>In particular, and to the extent permitted by law, PayRentz makes no warranties or representations:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Regarding the quality, accuracy, merchantability or fitness for purpose of third party material or products or services available through third party websites; or</li>\r\n	<li>That third party material does not infringe the intellectual property rights of any person. PayRentz is not authorizing the reproduction of third party material by linking material on this website to third party material.</li>\r\n</ul><span style=\"font-weight: bold;\">Software downloads</span>\r\n<p>Any software that is available to download through links from this website is a third party product unless otherwise indicated. Your use of that software may be subject to a license agreement between you and the software owner. To the extent permitted by law, PayRentz accepts no liability in respect of such third party software and PayRentz provides no warranty and gives no endorsement in respect of such products or any party connected with them. If you have any feedback or suggestions concerning this software, please contact us.</p><span style=\"font-weight: bold;\">Warranties</span>\r\n<p>PayRentz is not responsible for any error or omission on this website and reserves the right to make changes without notice. PayRentz does not guarantee that this website or third party websites will be free from viruses, or that access to this website or third party websites will be uninterrupted.</p><span style=\"font-weight: bold;\">Liability and complying with laws</span>\r\n<p>To the maximum extent permitted by law, and except to the extent expressly specified or referenced in these Terms of Use, PayRentz is not liable (whether in contract, tort, under statute or otherwise) for any loss, damage, or expense (including special, indirect or consequential loss, loss of profit or revenue, loss of use, legal costs and defense or settlement costs) that you or any other person incurs arising directly or indirectly out of or referable to material on this website or to third party material.</p>\r\n<p>Liability of PayRentz for a breach of a condition or warranty implied by law or otherwise, and which cannot be excluded, is limited to the maximum extent the law allows. You must comply with all laws in relation to your access or use of Material on this website, including laws of the country in which you reside or from which you access this website.</p><span style=\"font-weight: bold;\">Cancellation</span>\r\n<p>The agreement set out in these Terms of Use and your access to this website may be cancelled at any time by PayRentz without notice. All restrictions, licenses granted by you and all disclaimers and limitations of liability by PayRentz will continue after cancellation.</p><span style=\"font-weight: bold;\">General</span>\r\n<p>Efforts are taken to ensure the accuracy and integrity of information and related materials provided by the firm on this Website, but the firm is not responsible for misprints, out-of-date information, technical or pricing inaccuracies, typographical or other errors appearing on this Website. Information and related materials are subject to change without notice. Any part of these Terms of Use must be read down to the extent necessary to prevent that part or these Terms of Use being invalid, voidable or unenforceable in the circumstances. Despite that reading down, if a part of these Terms of Use is still invalid, voidable or unenforceable, and if the part would not be invalid or voidable if a word or words were removed, then that word or those words will be deleted, and the rest of these Terms of Use will continue to be fully enforceable. A right of PayRentz under these Terms of Use may only be waived in writing signed by PayRentz. You represent and warrant to PayRentz that you are at least 18 years of age and otherwise have the power, authority and capacity to agree to these Terms of Use with PayRentz.</p><span style=\"font-weight: bold;\">Description of Products</span>\r\n<p>The images, pictures, and illustrations found on this site are for illustration purposes only, and do not necessarily represent the exact products, services, or ideas in the context they are found in. It is the clients responsibility prior to purchase to clarify with our representative exactly what products and services are being provided for to purchase. We do not warrant that Product description or other content of this Website is accurate, complete, reliable, current, or error-free and assumes no liability in this regard.</p>\r\n<p>The price indications on the Website may vary due to some technical issue, typographical error or difference in product information and the firm shall not be responsible for the changed prices during the transaction. The terms and conditions of delivery, payment, etc. shall be governed by the Application and Agreement signed at the time of concluding the transaction.</p><span style=\"font-weight: bold;\">Rental Payment, Processing Fees and Refunds</span>\r\n<p>Our clients are requested to pay a refundable deposit which is normally equal to 3 months rent of the product chosen (varies according to each product) and Onetime non refundable processing charges of Rs. 500/- per product.</p>\r\n<p>Refundable deposit will be returned to you after the end of contact period or return of the product as the case may be. The returned products are subjected to quality check either at your place or at our office depending on the availability of our engineers. Upon clearance from quality team the rental deposit will be transferred (NEFT) to your account within one week. Clients are requested to share complete and accurate bank account details at the time of returning the product. Please note that the refundable deposit will be transferred to only the applicant / clients bank account, PayRentz does not endorse transacting with any other representative of the applicant unless otherwise the situation warrants such act, however in such an unavoidable situation it will be at the sole discretion of PayRentz. Any cost arising out of damages other than normal wear and tear will be deducted from the deposit.</p>\r\n<p>Clients may chose to pay rental amount online through NEFT/IMPS to our bank account . Alternatively, should you require our collection executives can visit your place on or before 7th of every month to collect cash or cheque at your convenience. Delayed payment of monthly rentals beyond due date shall attract charges of Rs.10 per product for each day of delay till the time the monthly rental is paid and failure to pay monthly rent before end of the month will result in termination of the agreement and removal of product.</p>\r\n<p>Non-payment of monthly rentals for one month could result in termination of agreement and removal of the products. The products rented from us should be only used for residential and single family use. Unauthorized relocation of products or any commercial use will result in immediate termination of the agreement. The firm will levy a charge of Rs. 500/- for any dishonoring of cheques.</p>', '', '', 1, 'Disclaimer - PayRentz', 'We are the sole distributors for international brands such as SOLE, XTERRA and STEX, LIVE UP many of which are award winners with wide literature online. bbbbb', 'Home appliance on rent, furniture on rent, cycle on rent, fridge on rent, washing machine on rent, rental fridge', '2017-10-13', 'Y', 1),
(2, 1, 'Contact Us', 'contact-us', '\r\n<div class=\"address\">            \r\n	<h3>Address</h3>             \r\n	<p><span style=\"font-weight: bold;\">PR Rental Solutions Pvt Ltd,</span> </p>             \r\n	<p>#24/53, Eldams Road, Teynampet, Chennai - 600 018.</p>             \r\n	<p>+91 89395 81818 / 044 4863 8090</p> \r\n  \r\n	<p><a href=\"mailto:rent@payrentz.com\">rent@payrentz.com</a></p>             \r\n	<p>www.payrentz.com</p>             \r\n	<h4>Branch Office: Chennai</h4>             \r\n	<p><span style=\"font-weight: bold;\">PR Rental Solutions Pvt Ltd,</span></p>             \r\n	<p>PayRentz, #232, Ground Floor, Mahatma Gandhi Road,</p>             \r\n	<p> Srinivasa Nagar, Velachery, Chennai - 600 042.</p>             \r\n	<h4>Branch Office: Coimbatore</h4>             \r\n	<p><span style=\"font-weight: bold;\">PR Rental Solutions Pvt Ltd,</span></p>             \r\n	<p>PayRentz, No:13/18, New Scheme Colony,</p>             \r\n	<p> Kavundampalayam, Coimbatore  641 030.</p>             \r\n               \r\n            \r\n	<p><span style=\"font-style: italic;\"></span><br />\r\n		</p>            \r\n	<!--\r\n	<p><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i><span> Mon-Fri 9.30 AM - 7.00PM</span></p>\r\n	-->\r\n	         </div>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d15547.845373975762!2d80.2535763!3d13.0381326!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xbc6efc08e2a9c0c1!2sPayRentz!5e0!3m2!1sen!2sin!4v1537189942175\" width=\"100%\" height=\"350\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', '', 2, 'Contact us | PayRentz', 'We are available to answer all your questions on business days between 9am and 9pm. Call us at +91 89395 81818 / 044 4863 8090', 'payrentz customer care, payrentz service request no, payrentz contact no, ac repair services, home appliances on rent, washing machine on rent, fridge on rent, ac on rent', '2017-10-13', 'Y', 1),
(3, 2, 'Terms of Use', 'terms--use', '<span style=\"font-weight: bold;\">Terms of Use</span>\r\n<p><span style=\"font-weight: normal;\">Use of this internet site is subject to these Terms of Use. Some uses of this site, including the order of rental of products through this internet site may be subject to additional terms displayed on the relevant pages of this internet site. PayRentz makes no representations or warranties in relation to this internet site, including without limitation: as to the accuracy or completeness of the information on this internet site; or that this internet site will be continuously available or free from any delay in operation or transmission, virus, communications failure, internet access difficulties or malfunction in hardware or software; or that PayRentz endorses any internet site linked to this internet site or any third party products or services referred to on this internet site. PayRentz is not liable for any loss or damage, howsoever caused (including but not limited to, by the negligence of the PayRentz) incurred in connection with this internet site, including but not limited to, as a result of reliance placed upon the information on this internet site.</span></p>\r\n<p><span style=\"font-weight: normal;\">You agree to the terms and conditions outlined in this Terms of Use (\"Terms of Use) with respect to www.payrentz.com (\"PayRentz\"/\"Website\"). These Terms of Use constitute the entire and only agreement between us and you, and supersedes all prior or contemporaneous agreements, representations, warranties and understandings with respect to the Website, the content, products or services provided by or through the Website. This Terms of Use may be amended from time to time by us without specific notice to you. The latest Terms of Use will be posted on the Website, and you should review this Terms of Use prior to using the Website at each instance. For the purpose of these Terms of Use, wherever the context so requires \"You\" or \"User\" shall mean any natural or legal person who has agreed to become a subscriber on the Website by providing information on the Website using the computer systems. There is no mandatory registration process and PayRentz allows the User to surf the Website or subscribe without registering on the Website. The term \"We\", \"Us\", \"Our\" shall mean the firm.</span></p>\r\n<p><span style=\"font-weight: normal;\">When you use the Website or send emails or other data, information or communication to us, you agree and understand that you are communicating with us through electronic records and you consent to receive communications via electronic records from us periodically and as and when required. We may communicate with you by email or by such other mode of communication, electronic or otherwise. If you provide PayRentz with information (such as text, photos or images) when using this site you warrant that you are entitled to provide and license the information and you license PayRentz to use, reproduce, modify and publish the information. The information on this site is subject to change without notice.</span></p>\r\n<p><span style=\"font-weight: normal;\">You shall not make any negative, denigrating or defamatory statement(s) or comment(s) about the firm or the brand name or domain name used by us including the terms PayRentz, PayRentz Rental Solutions, payrentz.com or otherwise engage in any conduct or action that might tarnish the image or reputation, of PayRentz or otherwise tarnish or dilute any PayRentz\'s trade or service marks, trade name and/or goodwill associated with such trade or service marks, trade name as may be owned or used by us. You may not use the Website or any content for any purpose that is unlawful or prohibited by these Terms of Use, or to solicit the performance of any illegal activity or other activity which infringes the rights of the Firm.</span></p>\r\n<p><span style=\"font-weight: normal;\">For any questions or comments on this website and In accordance with Information Technology Act 2000 and rules made there under, the contact details of the officer are provided below:</span></p>\r\n<p>The Privacy Officer</p>\r\n<p>PR Rental Solutions Pvt Ltd</p>\r\n<p>24/53, Eldams Road, Teynampet,</p>\r\n<p>Chennai  600 018.</p>\r\n<p><span style=\"font-weight: bold;\">Phone:</span>+91 89395 81818 (or) +91 99625 81818</p>\r\n<p><span style=\"font-weight: bold;\">Email:</span>rent@payrentz.com </p><span style=\"font-weight: bold;\">PayRentz Social Media Terms of Use</span>\r\n<p><span style=\"font-weight: normal;\">All users of our Social Media sites agree to the Terms and Conditions which prohibit inappropriate comments.</span></p>\r\n<p><span style=\"font-weight: normal;\">For the purpose of users creating content on our sites, we define inappropriate use as:</span></p>\r\n<ul>\r\n	<li>Libels or defames</li>\r\n	<li>Obscene</li>\r\n	<li>Pornographic</li>\r\n	<li>Abusive</li>\r\n	<li>Threatening</li>\r\n	<li>Infringes the intellectual property rights of any other person including (without limitation) infringing any person\'s copyright or trademark</li>\r\n	<li>Illegal</li>\r\n	<li>Advocates illegal activity</li>\r\n	<li>Advertises or solicits funds or is a solicitation for or offer to supply goods or services</li>\r\n</ul>\r\n<p><span style=\"font-weight: normal;\">Any comment that falls under any of the above categories will be deleted. The PayRentz Marketing Department will take necessary steps on best effort basis to send a private message to the person stating why their comment or post was deleted.</span></p>', '', '', 3, 'Terms of Use - Payrentz', 'Terms of Use', 'Terms of Use, home appliances on rent, furniture on rent, cycle on rent', '2017-10-13', 'Y', 1),
(4, 2, 'Privacy Policy', 'privacy-policy', '<span style=\"font-weight: bold;\">Privacy Policy</span>\r\n<p>www.payrentz.com is a website owned and operated by PR Rental Solutions Pvt. Ltd (\"PayRentz) a company duly incorporated under The Companies Act, 2013 with registered office at&nbsp; 24/53, Eldams Road, Teynampet, Chennai  600 018. PayRentz is strongly committed to protecting the privacy of your personal information.</p>\r\n<p>When this privacy policy refers to PayRentz, we or us, we mean the companies that make up the PayRentz Group and which are specified in this privacy policy. This privacy policy applies to PayRentz and its privacy practices in India. The Website is owned by an Indian firm and is located in India. Hence, we are duty bound to abide by the laws, regulations, rules, circulars, notifications etc governing privacy in India. This Privacy Policy is applicable to all users of this Website. The user is herein collectively referred to as \"You. You may note that this Privacy Policy may be found deficient with respect to certain privacy laws of some other countries.</p>\r\n<p>PayRentz has taken all necessary and reasonable measures to protect your personal information and handle the same in a safe and responsible manner in accordance with the terms and conditions of this policy (\"Privacy Policy) set out herein below.</p>\r\n<p>\"Personal information\" is any information that identifies you or that can reasonably enable your identification. This privacy policy provides you with information about how we manage your personal information, including certain types of credit-related personal information (credit information), and how you may contact us if you have any privacy concerns. In addition to this privacy policy we may on sometimes provide specific notifications about how we use particular personal information that we collect.</p><span style=\"font-weight: bold;\">The kinds of information we collect and hold</span><br />\r\n\r\n<p>The kinds of personal information that we collect and hold about you will depend on your interaction with us (e.g. online, in person or over the phone).</p>\r\n<p>The types of personal information we collect and hold about you include:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Your name, contact details (including your current and previous address), date of birth, gender and email address;</li>\r\n	<li>Information about your use of our services and products;</li>\r\n	<li>Employment information;</li>\r\n	<li>Information contained in credit reports obtained from credit reporting bodies, which includes information about your credit history with other credit providers;</li>\r\n	<li>Scores, ratings, summaries, evaluations and other information relating to your credit worthiness which is derived by us or by credit reporting bodies wholly or partly from any of the information above;</li>\r\n	<li>Bank account details; and</li>\r\n	<li>Identification documents.</li>\r\n</ul><span style=\"font-weight: bold;\">We share your personal information as described below:</span>\r\n<p>Business Transfers: If we start up subsidiaries or involve in mergers or acquisitions. In such case your Personal Information may be the matter of transfer. And we will provide notice on any such transfer and become subject to different privacy policy.</p>\r\n<p>Requirement under law: We release your Personal Information to third parties under following circumstances:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>To comply with the law, legal process or an enforceable governmental request;</li>\r\n	<li>To enforce or apply our terms of use or other agreements with you;</li>\r\n	<li>To protect the rights or safety of Website or our users or others. However, transfer under this case does not include selling, renting, sharing, or otherwise disclosing your Personal Information for commercial purposes in violation of the commitments set forth in this Privacy Policy</li>\r\n</ul>\r\n<p>We may also be required by law to collect your personal information. These laws include anti-money laundering and counter-terrorism financing legislation, national consumer credit protection legislation, personal properties securities legislation, as well as taxation and corporations laws. We will tell you if this is the case and let you know the details of the applicable law, court or tribunal order.</p>\r\n<p>If we cannot collect your personal information we may not be able to provide you with the services and products or assistance (or certain features) you require. The collection, use or disclosure of your personal information is needed to provide these.</p>\r\n<p>You may have the option, if it is lawful and practicable, to remain anonymous or use a name other than your own (a \"pseudonym) when you deal with us, For example, when you make a general inquiry about our services or products. However, you wont be able to remain anonymous or use a pseudonym if you want to rent or buy goods from us or if you would like to work with us. We need to be able to identify you.</p><span style=\"font-weight: bold;\">How do we collect your personal information?</span>\r\n<p>We collect your personal information as much as possible directly from you or from persons acting on your behalf, including when you complete our forms, call or email us or in our ongoing dealings with you. For example, we will collect information internally from your transactions in connection with credit, such as when you make payments to us. We may also collect personal information about you from publicly available sources, and in some cases, from third parties including:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Debt collection agencies;</li>\r\n	<li>Your referees (including your employer, your landlord);</li>\r\n	<li>Government, statutory, regulatory or enforcement bodies;</li>\r\n	<li>Credit reporting bodies;</li>\r\n	<li>Other lessors or credit providers (including for references and collections activities);</li>\r\n	<li>Your employer; and</li>\r\n	<li>Any other person or organization that you have asked us to collect your personal information from.</li>\r\n</ul><span style=\"font-weight: bold;\">Use and disclosure of your personal information <br />\r\n	</span>\r\n<p>We use and disclose your personal information for the purposes we collected it and for related purposes (where you would reasonably expect us to). We may collect, hold, use and disclose your personal information for the following general purposes:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Identifying you and carrying out appropriate checks to assess applications for credit (including assessing any proposed guarantors</li>\r\n	<li>Understanding your requirements and needs and how you interact with us, so that we can carry out product development, service research and develop our business strategies around providing you with our products or services;</li>\r\n	<li>Managing, including recovering, outstanding debts;</li>\r\n	<li>Undertaking secularization activities and debt assignments;</li>\r\n	<li>Enabling us to participate in the credit reporting system (including providing information to credit reporting bodies);</li>\r\n	<li>Establishing, administering and managing our services (including our accounts and agreements with you) and products;</li>\r\n	<li>Managing and training our employees and representatives;</li>\r\n	<li>Promoting and marketing our products and services to you;</li>\r\n	<li>Managing complaints and disputes; and</li>\r\n	<li>Meeting our legal and regulatory obligations (such as reporting matters to regulators or enforcement bodies when authorized or required by law).</li>\r\n</ul>\r\n<p>Some credit information may only be used or disclosed under the Privacy Act for some of these purposes or in some circumstances. If we need to use or disclose your personal information for a purpose that is not set out in our privacy policy, or that is unrelated to the purpose for which we collected your personal information, we will obtain your consent first. We may ask for your express consent or your consent may be implied by an action you take (or dont take). There are a range of people and organizations we disclose your personal information to. The particular party we may disclose your personal information to will depend on the dealings you have with us. Some examples of the parties to whom we may disclose your personal information include to:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Advisors and consultants (including our accountants, auditors and lawyers);</li>\r\n	<li>Financial institutions;</li>\r\n	<li>Third party services providers with whom we have contracted to provide services, for example, IT service providers, marketing services providers, auditors, business management consultants, mail and document management service providers;</li>\r\n	<li>Product manufacturers;</li>\r\n	<li>Debt collections agencies;</li>\r\n	<li>Government, statutory, regulatory or enforcement bodies;</li>\r\n	<li>External dispute resolution schemes;</li>\r\n	<li>Credit reporting bodies;</li>\r\n	<li>Other lessors or credit providers (including for references and collections activities);</li>\r\n	<li>Any other person or organisation that you have asked us to provide your personal information to; and</li>\r\n	<li>Any other organisation considering whether to acquire (or that has acquired) an interest in our business or any rights under your rental agreement or rent to own agreement with us.</li>\r\n</ul>\r\n<p>We seek to limit the information we provide these organizations to the minimum that they need to perform their services or activities for us or for you.</p><span style=\"font-weight: bold;\">Marketing</span>\r\n<p>We use personal information that we hold about you to identify services and products that may be of interest to you. We may contact you by email, text message, phone or by post to let you know about specials, our promotions or any new or existing products or services. We also use internet-based marketing including targeted online advertising and online behavioral marketing. We may also disclose your personal information in future to other PayRentz group companies, affiliates, franchisees to allow them (or us) to tell you about a product or service. Our marketing agencies may contact you using information about you that they already hold, or we may provide your personal information to them, in order to serve you with more relevant advertising about our services and products. You can contact us (see details below) at any time if you no longer wish to receive marketing materials from us or affiliates or our partners.</p><span style=\"font-weight: bold;\">How we keep your information secure<br />\r\n	</span>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>Securing information both in physical and electronic form;</li>\r\n	<li>Having internal procedures and measures limiting access to personal information to only those who need access for their legitimate activities; and</li>\r\n	<li>Protecting our IT systems by using appropriate technology solutions.</li>\r\n</ul>\r\n<p>We may be required by law to retain your personal information for a period of time after you have ceased your relationship with us. After such time has passed or if we otherwise determine that we no longer need information about you, we will securely destroy or de-identify your personal information. We will take reasonable technical and organizational precautions to prevent the loss, misuse or alteration of your personal information. We assure you of our best effort to protect personal information, however, we do not represent, warrant, or guarantee that your personal information will be protected against unauthorized access, loss, misuse, or alterations, and do not accept any liability for the security of the personal information submitted to us or third parties\' use or misuse of personal information.</p><span style=\"font-weight: bold;\">Will we disclose your personal information overseas?</span><br />\r\n\r\n<p>Some of our technology and operational service providers may be placed overseas in future if required. This means that when we decided to use these providers services, it may involve disclosing your personal information overseas. We only disclose personal information to our overseas service providers when it is necessary.</p><span style=\"font-weight: bold;\">Using other websites</span><br />\r\n\r\n<p>You should note that our website may contain links or references to other websites to which this privacy policy may not apply. You should review the privacy policy of each of those websites and assess whether those policies are acceptable to you before using those websites.</p><span style=\"font-weight: bold;\">Cookies</span><br />\r\n\r\n<p>When you browse our site we may collect and log the following types of information (\"Click stream data\") including without limitation:</p>\r\n<ul style=\"color:#6d6d6d;\">\r\n	<li>the date and time that you visit our site;</li>\r\n	<li>the amount of time you spend on our site;</li>\r\n	<li>the particular pages that you visit;</li>\r\n	<li>the type of browser you use;</li>\r\n	<li>the address of your server;</li>\r\n	<li>the address of the site that you have connected from;</li>\r\n</ul>\r\n<p>PayRentz does not use the click stream data or Cookies to personally identify you. We use the data on an aggregated and anonymous basis for purposes which include generating statistics, managing the effectiveness of our site, identifying repeat visitors, building anonymous profiles of visitors to enable content (including advertising and promotions) on the site to be tailored to them and for market research.</p><span style=\"font-weight: bold;\">Keeping your information up-to-date</span><br />\r\n\r\n<p>It is very important that the personal information we collect and hold about you is accurate, complete and up-to-date. During the course of our relationship with you we will ask you to keep us informed of any changes to your personal information. However, you can contact us (details provided in the website) at any time to update your personal information or to tell us that the information we hold about you is in any way inaccurate or incomplete.</p><span style=\"font-weight: bold;\">How you can access your personal information</span><br />\r\n\r\n<p>You may request access to, and the correction of, any of the personal information we hold about you by contacting us as set out below:</p>\r\n<p><span style=\"font-weight: bold;\">Phone :</span> +91 89395 81818 (or) 044 48638090</p>\r\n<p><span style=\"font-weight: bold;\">Email :</span>&nbsp; rent@payrentz.com</p>\r\n<p>When you contact us and request access to your personal information, we will need to verify your identity first and ask you further questions so that we can respond to your request as quickly as possible. We cant give you information about anyone else.</p>\r\n<p>We will handle all requests for access to your personal information as quickly as possible, and we will endeavor to process any such requests within short span of time. Some requests for access may take longer to process depending upon the nature of the personal information being sought.</p>\r\n<p>Making a request is free. But in some instances we may charge you a fee to cover the cost of retrieval and supply of information to you. The fee will not be excessive, and we will let you know if a fee will apply before we proceed with giving you access.</p>\r\n<p>There may be reasons why we cannot give you access to the information that you have requested, or we refuse to correct your personal information. If this is the case, we will let you know these reasons in writing. If we refuse you access or to correct your personal information, you can make a complaint about this, by following the complaint procedures in this privacy policy.</p><span style=\"font-weight: bold;\">Complaints, Queries and Feedback<br />\r\n	</span>\r\n<p>If you have any questions or feedback about this Privacy Policy or Website treatment of your Personal Information or concerns about our collection, use or disclosure of personal information, or if you believe that we have not complied with this privacy policy or the Privacy Act, please contact us as below.</p>The Privacy Officer<br />\r\nPR Rental Solutions Pvt Ltd.,<br />\r\n24/53, Eldams Road, Teynampet, Chennai  600018.<br />\r\nPhone: +91 89395 81818 (or) 044 48638090<br />\r\nEmail: rent@payrentz.com<br />\r\n\r\n<p>When contacting us, please provide as much detail as possible in relation to the query, issue or complaint. We will take your complaint seriously and it will be assessed by an appropriate person with the aim of resolving any issue in a timely and efficient manner. We ask that you cooperate with us during this process and provide us with relevant information we may require. All disputes between us and you in this regard are subject to exclusive jurisdiction of Chennai courts.</p><span style=\"font-weight: bold;\">Changes to this privacy policy<br />\r\n	</span>\r\n<p>We conduct regular reviews of all our policies and procedures and may change this privacy policy from time to time. By continuing to use our website or otherwise continuing to deal with us, you accept this privacy policy as it applies from time to time. Any changes to our privacy policy will be published on our website. So please check our website regularly for any updates to our privacy policy.</p>', '', '', 4, 'Privacy Policy - Payrentz', 'Privacy of individual visitor data is of primary importance to Meini. We work diligently to protect confidentiality, restrict transfer of personal data.', 'privacy policy, data privacy,  privacy law, payrentz privacy policy, payrentz data privacy', '2017-10-13', 'Y', 1),
(5, 2, 'About Us', 'about-us', '<span style=\"font-weight: bold;\">About PayRentz&nbsp;</span>\r\n<p><span style=\"font-weight: normal;\">PayRentz specializes in providing rental solutions to clients by offering a wide range of Appliances, Home Entertainment, Furniture and Fitness Products apart from other customized requirements. Whatever may be your rental needs, PayRentz has it covered with a solution tailored for you. Our objective is to make life easy for clients by offering customized rental solutions which includes speedy delivery, free transportation, free standard installation, flexible payment options and prompt service delivery.</span></p>  \r\n<p><span style=\"font-weight: normal;\">PayRentz is founded and run by a team of professionals who quit lucrative corporate careers after working with top financial institutions and software companies for more than a decade. PayRentz aims to become the leading and preferred rental solutions provider in the country. Each member of the founding team has taken individual responsibility of Sales, Credit, Operations and Service to ensure that all the said functions are given its due attention to achieve remarkable client experience.</span></p>  \r\n<p><span style=\"font-weight: normal;\">Be it big or small, Home is a place where people rejuvenate themselves on a daily basis and we endorse that a great home is the key to the success of every individual. In the process of creating a great home, we partner with our clients, help them make an informed choice and shoulder the responsibility of furnishing and transforming the place. We do this job well and invariably land up creating a feel good environment at home to suit an individuals style and needs.</span></p>', '', '', 5, 'About Us - Payrentz', '', 'payrentz about us, payrentz business solutions, home appliances one rent, furniture on rent, cycle on rent', '2017-12-24', 'Y', 1),
(6, 2, 'Why Rent', 'why-rent', '<span style=\"font-weight: bold;\">Why Rent</span>\r\n<p>Wondering whether rental is advisable? Absolutely. Renting is a great idea and the new mantra, we tell you why. Go for it.</p><span style=\"font-weight: bold;\">Helps your wallet</span>\r\n<p>Renting eliminates the upfront costs of buying products and helps you to maintain liquidity and healthy cash flow. You pay monthly rent to PayRentz for the products rented as you pay for your monthly utility bills. Renting with PayRentz also means that you need not postpone your decision to posses the desired product of your choice.</p><span style=\"font-weight: bold;\">Rent to Own</span>\r\n<p>We strive to make sure you have a remarkable experience with our product at all times. As a distinct advantage with PayRentz, you can choose to own the product after a minimum rental period of 3 months. Exercising the option to buy provides you continuity of product and at a price that is reasonable and attractive. As an additional benefit, we would continue to provide service support for a period of 6 months from the time you buy the product.</p><span style=\"font-weight: bold;\">Saves Time</span>\r\n<p>In the process of finding the right product and model, are you researching all available ecommerce portals for a great deal and burning your time or your family time? Stop! Call PayRentz and leave the problem to us. We help you to make an informed choice quickly and furnish your place to your expectation.</p><span style=\"font-weight: bold;\">Service and Maintenance</span>\r\n<p>Imagine the hassles of talking to multiple call centre executives and requesting them for servicing your various products, not everybody likes it and has the luxury of time. Rent from PayRentz and call us for any service issues on our products. Our service team will attend to the issues at your convenience.</p><span style=\"font-weight: bold;\">Replacement</span>\r\n<p>What more? PayRentz will provide an alternate product in the interim, if our service team identifies an issue which requires more time to resolve. We believe that our clients should have uninterrupted experience of the products rented from PayRentz.</p><span style=\"font-weight: bold;\">People on the Move</span>\r\n<p>Take on the lifes challenge of tossing you from once place to another. Leaving home for a new place, relocating often? PayRentz is here to help. You can have what you need now and choose to rent for a period that suits you.</p><span style=\"font-weight: bold;\">Upgrade Periodically</span>\r\n<p>Gone are those days where you grew up with the same TV or Refrigerator for years together. With technology moving at such a rapid pace, renting makes perfect sense. Why buy when it could be outdated in a couple of years.</p><span style=\"font-weight: bold;\">Happy Family</span>\r\n<p>Need a second TV or Microwave or Refrigerator for your parents or children or yourself? Renting is the obvious choice, since the additional rental product offered by PayRentz can be returned after the desired rental period.</p><span style=\"font-weight: bold;\">Gift your loved ones</span>\r\n<p>Now, you need not wait to see your loved ones smile. Rent a desired product immediately than postponing the decision to purchase it. Call PayRentz to install the rental product for your family even if you are abroad or away on work. Planning to donate products for a cause (Home for Children, Old age home, Community gym, Contribution to alma mater etc), you need not necessarily buy, you can rent it too. Call PayRentz to install and manage the rental product on your behalf.</p>', '', '', 6, 'Why Rent - Payrentz', '', 'Home Appliances on Rent, Home Appliances for Rent, Furniture for rent, furniture on rent, cycle on rent, cycle for rent', '2017-12-24', 'Y', 1),
(7, 2, 'How It Works', 'how-it-works', '<span style=\"font-weight: bold;\">How it Works</span>\r\n<p>Our objective is to make life simple and easy for clients. Browse our website, identify the products of your choice and then reach out to us. You may choose to call us / send an email / fill your details in the contact us page. We will promptly initiate a dialogue to understand your requirements and initiate process to fulfill the same. Our representative will meet you in person to complete the application and documentation procedure. Once the application is screened and approved by our credit team, we will check on your convenience to deliver and install the product.</p><span style=\"font-weight: bold;\">When and where do you deliver?</span>\r\n<p>PayRentz delivers products only at the address provided in the application. We deliver the products within 2-3 business days from the time of order confirmation and PayRentz credit team approval.</p><span style=\"font-weight: bold;\">Should I be present for delivery and installation?</span>\r\n<p>PayRentz advises you / your authorized representative to be present during delivery and installation. We will manage the delivery and installation at your convenience. A confirmation on the condition report of the product will be obtained by the executive upon successful delivery and installation from you or your authorized representative.</p><span style=\"font-weight: bold;\">Who is responsible for products delivered with damage?</span>\r\n<p>We do a thorough quality check at our site before dispatch of products for delivery. In case of a highly unlikely event of damages incurred in transit, PayRentz will refrain from installing the same and furnish a new product. Your confirmation will be obtained by the executive upon successful delivery and installation.</p><span style=\"font-weight: bold;\">What is covered as part of standard delivery and installation?</span>\r\n<p>PayRentz, as a policy is committed to offer free standard delivery and installation of products. Standard delivery means delivery of the products to your premises. If your building has lift and our team is granted permission to use it for delivery it will still be considered as standard delivery. Labor charges apply at actuals to deliver products in case of denial of permission to use lift or absence of lift.</p>\r\n<p>Standard installation means placement of products in working condition at the designated place in your home. Charges will apply to any deviation to the standard installation. For Eg: Specific request to install TV on the wall, iron angle or additional tubes requirement for outdoor AC unit, additional plumbing or electrical work for appliances installation are all not part of the standard installation process. PayRentz executive will explain the standard delivery and installation capabilities before you sign the application. Please feel free to talk to our representative for more details. Assuring you the best of services always.</p>', '', '', 7, 'How It Works - Payrentz', '', 'PayRentz website, home appliances rental process, rental process, rent furniture', '2017-12-24', 'Y', 1);
INSERT INTO `tbl__tlink` (`tl_id`, `tl_split`, `tl_name`, `tl_slug`, `tl_content`, `tl_map`, `tl_link`, `tl_pos`, `tl_seo_title`, `tl_seo_description`, `tl_seo_keywords`, `tl_dt`, `tl_status`, `cl_id`) VALUES
(8, 2, 'FAQ', 'faq-payrentz', '<span style=\"font-weight: bold;\">Frequently Asked Questions:<br />\r\n	<br />\r\n	</span><span style=\"font-weight: bold;\">What is the minimum rental period?</span>        \r\n<p>PayRentz products can be rented for a minimum period of 3 months.</p><span style=\"font-weight: bold;\">Is there an agreement?</span>\r\n<p>Yes, you need to sign the Terms and Conditions provided along with the application form.</p><span style=\"font-weight: bold;\">How can I terminate the rental agreement?</span>\r\n<p>The rental contract gets terminated\r\non completion of the original rental duration agreed (subject to minimum rental period of 3 months) . The contract can also be\r\nterminated by either of the parties by &nbsp;giving\r\n&nbsp;15 days notice .&nbsp; Notwithstanding the above, if the rent amount\r\npayable and due remains unpaid for more than 15 days from the due date, the\r\nrental contract stands automatically terminated. In such a case, the client is expected\r\nto arrange to return the products forthwith and facilitate PayRentz team to\r\ntake possession of the products so given on rent.&nbsp;</p><span style=\"font-weight: bold;\">How much rent do I need to pay and when?</span>\r\n<p>Clients are encouraged to pay rent for the products on or before 7th of every month. Kindly refer to the product categories listed along with rent details in the website. Rent will be communicated without any ambiguity at the time of delivery and it will be documented in the application form.</p><span style=\"font-weight: bold;\">Are there any late payment charges applicable?</span>  \r\n<p>Clients are encouraged to pay rent for the products on or before 7th of every month. Any delay in payment of rental amount would attract late payment charges of Rs.10 per product for each day of delay, to be levied at the discretion of PayRentz.</p><span style=\"font-weight: bold;\">How much should I pay as advance?</span>\r\n<p>Clients will pay a refundable deposit which is normally equal to 3 months rent of the product chosen (varies according to each product) and Onetime non refundable processing charges of Rs. 500/- per product.</p><span style=\"font-weight: bold;\">Are there any other charges apart from rent, processing charges and refundable deposit?</span>\r\n<p>No.</p><span style=\"font-weight: bold;\">When will I get my refundable deposit?</span>\r\n<p>Refundable deposit will be returned to you after the end of contact period or return of the product as the case may be. The returned products are subjected to quality check either at your place or at our office depending on the availability of our engineers. Upon clearance from quality team the rental deposit will be transferred to your account within 4-5 working days. Any cost arising out of damages other than normal wear and tear will be deducted from the deposit.</p><span style=\"font-weight: bold;\">How can I pay the rent?</span>\r\n<p>You may choose to pay Online (NEFT/IMPS) into our bank account details shared with you. You may also visit our website and chose to make payment thru various options available including e-wallets. Alternatively , you may inform us to send our collection executive to visit your place on or before 7th of every month to collect cash or cheque at your convenience.</p><span style=\"font-weight: bold;\">When can I expect the delivery of the product?</span>\r\n<p>Once you submit the application along with required information and supporting documents, speedy credit verification and approval process is initiated. Our average delivery timeline is 3-5 business days from the date of application.</p><span style=\"font-weight: bold;\">Who will take care of the installation?</span>\r\n<p>PayRentz team will take care of standard installation. Any additional effort (no lift etc.) towards delivery and customization on installation will be at additional cost to be borne by the client. Please speak to the executive while submitting the application for more details.</p><span style=\"font-weight: bold;\">What are the documentation requirements?</span>\r\n<p>PayRentz requests clients to submit copy of standard KYC documents covering ID proof, address proof (permanent and current address) and company ID card along with duly completed application form. We request you to show the original document to the executive while signing the application which enables speedy verification and approval.</p><span style=\"font-weight: bold;\">Can I continue the service when I relocate?</span>\r\n<p>Kindly check with PayRentz team to get the latest list of locations we operate. Relocation of products is to be handled only by PayRentz team. Clients are advised to inform us 15 days in advance to help you in relocation. Kindly note appropriate documentation requirements and relocation charges will apply.</p><span style=\"font-weight: bold;\">Can I rent your products for a short period?</span>\r\n<p>The minimum rental period of products is 3 months. On a standardized basis, you may choose to terminate the agreement during this period. In such an event, PayRentz would retain the initial deposit. Pro-rata rent for the month and onetime processing charges as applicable would be charged. You may choose to call us for any specific requirements. We will be happy to explore other possibilities.</p><span style=\"font-weight: bold;\">Is there a penalty applicable for any damage?</span>\r\n<p>In the event of an unintentional damage to any of our products, please do call us and lodge a service request with details of damage. We advise you to not engage any other service engineer which is considered as breach of the agreement. Cost of repair / damage to be borne by the client at actuals. Cost of product will be recovered in the event of any irreparable damages or at the sole discretion of PayRentz.&nbsp;</p><span style=\"font-weight: bold;\">Can I buy the product from PayRentz during the rental period?</span>\r\n<p>Yes. As a distinct advantage with PayRentz, you can choose to own the product after a minimum rental period of 3 months. Exercising the option to buy provides you continuity of product and at a price that is reasonable and attractive. As an additional benefit, we would continue to provide service support for a period of 6 months from the time you buy the product.</p><span style=\"font-weight: bold;\">How do I register a complaint or feedback?</span>\r\n<p>Please call us at +91 89395 81818 (or) 044 4863 8090 from 10am to 7pm on all working days or email us at rent@payrentz.com</p><span style=\"font-weight: bold;\">Can my friend or nominee take over my rental product?</span>\r\n<p>Yes, please inform us 15 days in advance to execute necessary documentation and activate the new client profile.</p><span style=\"font-weight: bold;\">What should I do in case of a service / maintenance request?</span>\r\n<p>Please visit our website for registering a service request. Ongoing service / maintenance will be managed by us at no additional cost. Cost of spares and damage to be borne by the client at actuals. Depending on the lead time for service in case of a repair, we will attempt to provide a replacement until your product is ready.</p><span style=\"font-weight: bold;\">Are my personal details maintained with you safe?</span>\r\n<p>Yes, we deal with your details with utmost confidentiality. Your personal details will not be shared with anybody.</p><span style=\"font-weight: bold;\">What is my deliverable on maintenance of the product?</span>\r\n<p>We expect you to handle the products with care as it avoids issues and provides uninterrupted service. Please note our clients also choose to buy the same product during the rental period and hence a proper care helps.</p><span style=\"font-weight: bold;\">What is the average time to complete your approval process?</span>\r\n<p>We would endeavor to complete the approval process and deliver of the product within 3-5 working days upon receipt of your application complete in all respects.</p><span style=\"font-weight: bold;\">I want to rent more products, what should I do?</span>\r\n<p>We will be happy to process your request. We will be able to deliver the products faster for existing clients. Kindly note onetime Processing charges of Rs. 500/- apply per product.</p><span style=\"font-weight: bold;\">What is your Refund/cancellation policy?</span>\r\n<p>At PayRentz,\r\ncustomer satisfaction is of paramount importance. We strive to ensure that\r\nquality products are provided to all clients at all times. In the unlikely\r\nevent of you not being satisfied with our services/ products,&nbsp; you may chose to cancel the rental contract\r\nand we would be happy to process your cancellation/ refund request. However\r\nplease note that such refund/ cancellation would be subject to below terms:<br />\r\n	-&nbsp; At the time of initial delivery\r\nof products pursuant to your application, in case you are not happy with the\r\nproducts, &nbsp;the same has to be highlighted\r\nat the time of delivery itself. In that scenario we will just deduct &nbsp;only the handling charges and refund the deposit\r\namount paid by you. The refund would be processed with 5 working days.<br />\r\n	-&nbsp; After delivery of products and\r\nduring the tenor of the rental contract, in case you wish to cancel the\r\ncontract , you are requested to provide 15 days notice for termination of the\r\ncontract. A minimum &nbsp;rent equal to that\r\nof 3 months would be payable by you. The deposit amount will be refunded after aforesaid\r\nadjustment. Deposit paid cannot be adjusted towards rent or arrears of rental amount overdue<br />\r\n	-&nbsp; Such refund would be processed\r\nonly after a clearance report is received from our quality team who would check\r\nfor any damages/ proper functioning of the products provided on rent.<br />\r\n	- Any such refund made pursuant to cancellation\r\nof the contract will be made only to the Bank Account of the applicant and no\r\ncash payment request will be entertained.<br />\r\n	<br />\r\n	</p>', '', '', 8, 'FAQ - PayRentz', 'Frequently Asked Questions - PayRentz', 'faq for payrentz, home appliances on rent, furniture on rent, cycle on rent, payrentz refund policy', '2017-12-24', 'Y', 1),
(9, 2, 'FAQ Delivery & Installation', 'faq-delivery-and-installation', '\r\n<h3>Gobi<br />\r\n	<br />\r\n	1. How do I learn more about a product?</h3>                    \r\n<p>In case you have questions about a product, please write to our customer care and we will get back to you within 24 hours. You can also chat with us between 10 AM to 8PM on our website by using the chat option.</p>                    \r\n                    \r\n<h3>2. How do I pay my deposit and rent?</h3>                    \r\n<p>Payments are super convenient with Payrentz. You can pay the entire deposit through your Payrentz dashboard at once or simply book the furniture with a token amount of INR 500 and pay the rest at the time of delivery through your credit/debit card. The option of book and pay is valid on cart value of INR 1000 and above. For your monthly rent, we will send a link on your registered email id and you can pay through your dashboard</p>                    \r\n                    \r\n<h3>3. What is the rental value I pay and when do I pay it?</h3>                    \r\n<p>Its simple! Select the products you like and you will see the total rental value in your cart. Rent is due on the 1st of every month and can be paid online through your Payrentz dashboard. Your first &amp; last month\'s rent is calculated on a pro-rata basis from the date of delivery. Billing cycle is 1st to last of that month.</p>                    \r\n                    \r\n<h3>4. Is there any contract? What are the terms?</h3>                    \r\n<p>We have a simple contract that you need to sign when the products arrive at your home. Contract includes basic terms of renting, payment, refund and damage policy. </p>                    \r\n                    \r\n<h3>5. What documents are required to get into the contract?</h3>                    \r\n<p>For our easy KYC process we require the below mentioned documents at the time of signing the contract.<br />\r\n	<br />\r\n	Photo ID proof(any one):Passport/PAN Card / Driving License / Aadhar Card.<br />\r\n	Address proof (Any one) : House rental agreement / Address proof on company letterhead / Govt. issued proof / Bank Statement. \r\nNOC from the owner if you are living in rented house.<br />\r\n	<br />\r\n	Yes, the document submission is mandatory. Rest assured, your details are safe with us :)</p>', '', '', 9, 'FAQ Delivery & Installation - Payrentz', '', '', '2017-12-24', 'N', 1),
(10, 2, 'FAQ Rental Process & Tenure', 'faq-rental-process-and-tenure', '<h3>1. How do I learn more about a product?</h3>                     <p>In case you have questions about a product, please write to our customer care and we will get back to you within 24 hours. You can also chat with us between 10 AM to 8PM on our website by using the chat option.</p>                                          <h3>2. How do I pay my deposit and rent?</h3>                     <p>Payments are super convenient with Payrentz. You can pay the entire deposit through your Payrentz dashboard at once or simply book the furniture with a token amount of INR 500 and pay the rest at the time of delivery through your credit/debit card. The option of book and pay is valid on cart value of INR 1000 and above. For your monthly rent, we will send a link on your registered email id and you can pay through your dashboard</p>                                          <h3>3. What is the rental value I pay and when do I pay it?</h3>                     <p>Its simple! Select the products you like and you will see the total rental value in your cart. Rent is due on the 1st of every month and can be paid online through your Payrentz dashboard. Your first & last month\'s rent is calculated on a pro-rata basis from the date of delivery. Billing cycle is 1st to last of that month.</p>                                          <h3>4. Is there any contract? What are the terms?</h3>                     <p>We have a simple contract that you need to sign when the products arrive at your home. Contract includes basic terms of renting, payment, refund and damage policy. </p>                                          <h3>5. What documents are required to get into the contract?</h3>                     <p>For our easy KYC process we require the below mentioned documents at the time of signing the contract.<br/><br/> Photo ID proof(any one):Passport/PAN Card / Driving License / Aadhar Card.<br/> Address proof (Any one) : House rental agreement / Address proof on company letterhead / Govt. issued proof / Bank Statement.  NOC from the owner if you are living in rented house.<br/><br/>  Yes, the document submission is mandatory. Rest assured, your details are safe with us :)</p>', '', '', 10, '	 FAQ Rental Process & Tenure - Payrentz', '', '', '2017-12-24', 'N', 1),
(11, 2, 'FAQ Refunds & Returns', 'faq-refunds-and-returns', '<h3>1. How do I learn more about a product?</h3>                     <p>In case you have questions about a product, please write to our customer care and we will get back to you within 24 hours. You can also chat with us between 10 AM to 8PM on our website by using the chat option.</p>                                          <h3>2. How do I pay my deposit and rent?</h3>                     <p>Payments are super convenient with Payrentz. You can pay the entire deposit through your Payrentz dashboard at once or simply book the furniture with a token amount of INR 500 and pay the rest at the time of delivery through your credit/debit card. The option of book and pay is valid on cart value of INR 1000 and above. For your monthly rent, we will send a link on your registered email id and you can pay through your dashboard</p>                                          <h3>3. What is the rental value I pay and when do I pay it?</h3>                     <p>Its simple! Select the products you like and you will see the total rental value in your cart. Rent is due on the 1st of every month and can be paid online through your Payrentz dashboard. Your first & last month\'s rent is calculated on a pro-rata basis from the date of delivery. Billing cycle is 1st to last of that month.</p>                                          <h3>4. Is there any contract? What are the terms?</h3>                     <p>We have a simple contract that you need to sign when the products arrive at your home. Contract includes basic terms of renting, payment, refund and damage policy. </p>                                          <h3>5. What documents are required to get into the contract?</h3>                     <p>For our easy KYC process we require the below mentioned documents at the time of signing the contract.<br/><br/> Photo ID proof(any one):Passport/PAN Card / Driving License / Aadhar Card.<br/> Address proof (Any one) : House rental agreement / Address proof on company letterhead / Govt. issued proof / Bank Statement.  NOC from the owner if you are living in rented house.<br/><br/>  Yes, the document submission is mandatory. Rest assured, your details are safe with us :)</p>', '', '', 11, 'FAQ Refunds & Returns - Payrentz', '', '', '2017-12-24', 'N', 1),
(12, 2, 'Rent To Own', 'rent-to-own', '<span style=\"font-weight: bold;\">How it Works</span>\r\n<p>Our objective is to make life simple and easy for clients. Browse our website, identify the products of your choice and then reach out to us. You may choose to call us / send an email / fill your details in the contact us page. We will promptly initiate a dialogue to understand your requirements and initiate process to fulfill the same. Our representative will meet you in person to complete the application and documentation procedure. Once the application is screened and approved by our credit team, we will check on your convenience to deliver and install the product.</p><span style=\"font-weight: normal;\">When and where do you deliver?</span>\r\n<p>PayRentz delivers products only at the address provided in the application. We deliver the products within 2-3 business days from the time of order confirmation and PayRentz credit team approval.</p><span style=\"font-weight: normal;\">Should I be present for delivery and installation?</span>\r\n<p>PayRentz advises you / your authorized representative to be present during delivery and installation. We will manage the delivery and installation at your convenience. A confirmation on the condition report of the product will be obtained by the executive upon successful delivery and installation from you or your authorized representative.</p><span style=\"font-weight: normal;\">Who is responsible for products delivered with damage?</span>\r\n<p>We do a thorough quality check at our site before dispatch of products for delivery. In case of a highly unlikely event of damages incurred in transit, PayRentz will refrain from installing the same and furnish a new product. Your confirmation will be obtained by the executive upon successful delivery and installation.</p><span style=\"font-weight: normal;\">What is covered as part of standard delivery and installation?</span>\r\n<p>PayRentz, as a policy is committed to offer free standard delivery and installation of products. Standard delivery means delivery of the products to your premises. If your building has lift and our team is granted permission to use it for delivery it will still be considered as standard delivery. Labor charges apply at actuals to deliver products in case of denial of permission to use lift or absence of lift.Standard installation means placement of products in working condition at the designated place in your home. Charges will apply to any deviation to the standard installation. For Eg: Specific request to install TV on the wall, iron angle or additional tubes requirement for outdoor AC unit, additional plumbing or electrical work for appliances installation are all not part of the standard installation process. PayRentz executive will explain the standard delivery and installation capabilities before you sign the application. Please feel free to talk to our representative for more details. Assuring you the best of services always.</p><span style=\"font-weight: normal;\">How do I refer a friend and is there a reward for referral?</span>\r\n<p>You could earn an attractive gift voucher worth Rs. 250/- for every person you refer to us. Once your friends application is successful and he/she enrolls as a PayRentz customer, we will send the gift voucher in person or through courier. Referrals can be made through phone or email or by filling up your details and that of your friend in our contact us page.</p>', '', '', 7, 'How It Works - Payrentz', '', '', '2017-12-24', 'Y', 1),
(13, 2, 'Terms And Conditions', 'terms--conditions', '<span style=\"font-weight: bold;\">Terms &amp; Conditions:</span>\r\n<p><span style=\"font-weight: normal;\"></span></p>Please read the\r\nfollowing terms and conditions as these terms of use (\"Terms\")\r\nconstitute a legally binding agreement between you and PR Rental Solutions Pvt\r\nLtd ( hereinafter referred to as \"PayRentz)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />\r\n\r\n<ul>\r\n	<li>The rental contract is for a\r\nminimum period of 3 months.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Two weeks notice to be provided\r\nto terminate the contract or return the products.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Rent to be paid on or before\r\n7th of every month.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Late payment charges of Rs. 10\r\nper day per product applicable in case of delayed payment.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Security Deposit cannot be\r\nadjusted for rental dues.&nbsp;</li>\r\n	<li>Refund of security deposit will be made within 3\r\nworking days from the date of return of products and satisfactory completion of\r\ncontract closure formalities including quality clearance from our QC team.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>In case rent remains\r\noverdue/unpaid for 15 days from the due date, then the rental contract\r\nautomatically stands terminated without requirement of further notice. In such\r\na case, the client would make necessary arrangements to return the product and\r\nallow PayRentz to take possession of the products given on rent.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>In case the applicant is\r\nmoving&nbsp; out of the premises, then he/she\r\nto handover the products or complete name transfer formalities before leaving\r\nthe premises.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Charges applicable at actuals\r\nfor any customised delivery/ installation.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Do not engage a third party for\r\nany repair /service of the product.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Cost of spares, if any, during\r\nrepair/service will be charged at actuals.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Any physical damage /\r\nmishandling of the product is the sole responsibility of the applicant.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>Products rented from PayRentz\r\nare meant only for legal and single household residential purposes.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</li>\r\n	<li>PayRentz reserves the right, at\r\nits discretion, to change, modify, add, or remove portions of these Terms at\r\nany time by posting the amended Terms in the website.&nbsp;</li>\r\n</ul><br />\r\nDeclaration:&nbsp; <br />\r\n<br />\r\nI hereby certify that all the details provided by me\r\nin my application form are true and correct in all respects. PayRentz is\r\nauthorised to verify this directly or through any third party. I understand\r\nthat the decision to extend any rental solution by PayRentz will be dependent on the information provided in the application.&nbsp; I have read the terms and conditions above\r\nand agree to abide by terms of PayRentz (www.payrentz.com) which may be in force from time to time\r\nduring the course of the contract.\r\n<p><span style=\"font-weight: normal;\"></span></p>', '', '', 3, 'Terms And Conditions - PayRentz', 'Terms And Conditions', 'payrentz terms and condition, terms and condition for payrentz', '2017-10-13', 'Y', 1);
